import React from "react";
import Aux from "./Auxliliary/Auxiliary";
import "./App.css";
import Arr from "./Arr";
import Card from "./Card";
import bg from "./Images/tree.jpg"

function App() {

  return (
    <Aux>
    <Card head1 = "This is the 1st Image"
    imgsrc = {bg} />
    </Aux>
  );
}

export default App;
